         { /* <Route path="/register" component={Register} /> */}

        { /*  <PrivateRoute exact path="/" component={Home} />*/}

          {/* <Route path="/MyAccount" component={MyAccount} /> */}
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
